(28, 28, 22, 1, 20, '', 'Movement', 0, '', 60, 'I teach a weekly Duncan dance class in Oakland, CA for adults, and taught children''s Duncan dance.  I have taught several one to one and a half hour individual class''s on Duncan movement for Bay Area colleges and universities.', '', '[u''0'', u''3'', u''4'']', '0', '', 'No'),
