(44, 44, 36, 1, 30, '', 'Movement', 0, '', 60, 'I taught Ballet for Burlesque at the 2014 GBE, and it was a blast! I''ve been teaching ballet for over 10 years.', '', '[u''0'', u''1'', u''2'', u''3'', u''4'']', '0', '', 'No'),
