(109, 109, 72, 1, 20, '', 'Movement', 0, '', 90, 'Yes, both for students of all ages as part of swimming and dance programs in New York and New Jersey, and at Burly Con 2014. \r\n\r\nHere is a link to the video of the routine the students learned at Burly Con!\r\n\r\nhttps://m.facebook.com/story.php?story_fbid=10204510583551920&id=1452738893\r\n\r\nWe were able to keep the hotel pool open to the hotel''s guests and still had plenty of room to learn.  ', '', '[u''1'', u''2'', u''3'', u''4'']', '0', '', 'No');
INSERT INTO `gbe_classproposal` (`id`, `title`, `name`, `email`, `proposal`, `type`, `display`) VALUES
(1, 'The Body of Work: Longevity in Burlesque', 'letter.scarlett@gmail.com', '', 'A discussion of how to stay fresh in an ever evolving artistic medium, while still producing work that can be identified as yours and representative of your ideals and perspective. Ideally a mix of new and seasoned performers, maybe a legend, if available.', 'Panel', 0),
(2, 'Being a Backstage Star', 'missmina@miss-mina.com', '', 'This is a class for potential stage kittens/hands/managers. So often volunteers are thrust into this position with little experience or guidance. Experienced backstage workers talk about what the jobs require and how to do them well without stressing out yourself or the performers. Guilted Lily would be good person to be involved as she is an AWESOME stage kitten. ', 'Either', 0),
(3, 'BABEfit', 'MandyWencus@Yahoo.com', '', 'Hi Scratch and crew, I''m having a hard time with the submit a class form, it keeps saying I am missing necessary items when every section is filled in so I am trying this form to see where it brings me.\r\n\r\nI would love to teach a morning BABEfit class during at least one morning of the expo.\r\n\r\nI was thinking this class could be offered both as a drop in and for people with passes but I suppose that may be up to you.\r\n\r\nA fun burlesquey cardio dance combo class with a warm up, conditioning and floor up, finished up with some yoga and stretching.\r\n\r\nI figure this could be of interest to anyone attending the expo looking for a fun morning work out.\r\n\r\nThanks!\r\n\r\nMandy', 'Class', 0),
(4, 'Shooting Burlesque Performers', 'Scratch', '', '(Could be a panel too)\r\n\r\nThis session would be designed to address photographers who want to work at burlesque shows.  It could include anything from \r\n* how to approach a producer or performer, \r\n* what to offer and what to expect, \r\n* how to behave in the audience or backstage\r\n* technical hints for working in low light areas with subjects that are in motion\r\n* how to deliver the images and who gets to do what with them', 'Class', 0),
(5, 'On Towards Greatness: Troupe Leadership Strategies', 'ravenlaroux.burlesque@gmail.com', '', 'Do your rule your troupe with strict guidelines or is it more of a laissez-faire style? What types of written and/or legal documents - if any - do you require your members to sign and why?  What works and what just plain falls flat amongst leadership styles when managing a troupe full of burly ladies & gents? Come and hear what our panelists have to say about their many collective years of experience in managing successful troupes all across the country (and around the world)!', 'Panel', 0),
(6, 'Bringing Burlesque to the ''Burbs', 'heatherwhatevernyc@gmail.com', '', 'I''d like to arrange a panel of performers and producers from small cities and suburbs to inform other producers and performers of some of the challenges, successes, and laws controlling performance of burlesque in locations outside of major cities.  ', 'Panel', 0);
INSERT INTO `gbe_event` (`id`, `title`, `description`, `blurb`, `duration`, `notes`) VALUES
(22, 'Cancan', 'Each Cardio-Cancan class starts with a ballet based warmup and stretching. Then we go over specific steps and techniques for cancan kick lines, traveling steps and turns. Finally, get your heart pumping with flirty cancan choreography! It’s so much fun, you won’t even realize you are working out!  ALL LEVELS OF FLEXIBILITY AND DANCE EXPERIENCE WELCOME!  This class has been designed to provide an introduction to classic ballet techniques in a comfortable environment for those who have never taken formal dance classes before. At the same time, experienced dancers will enjoy the sense of play, enjoyment and sensuality in the class, which can be hard to find in many traditional ballet studios.', '', 0, ''),
(28, 'What the Hell is Isadora Duncan Dance?', 'Are you a dancer?  A non-dancer?  Have you heard of Isadora Duncan?  Come learn the basic concepts of Isadora Duncan dance and find out why she is one of the "mothers of modern dance."   Learn the underlying movements, exercises, and basic Duncan "vocabulary" moves.  Isadora Duncan was falling out of her Grecian tunics  and dancing barefoot in the days of corsets and long skirts and her sensuality and stage presence were renowned. Wear comfortable clothes for dancing and no shoes or socks only please!  ', '', 0, ''),
(29, 'My Real Name Is', 'Panel discussing the use of stage names and personas and the risks/problems of being forced to use your real identity.   How do social media restrictions harm us and benefit us?  How can we move to marketing and outreach methods that rely less on social media or is that a new standard that we must deal with?  Is it effective to switch social networks when our customer base is left behind on the old one?', '', 0, ''),
(30, 'Inspired Not Copied', 'What inspires you as a performer?  How do you make sure it is inspiration and not a copy?  Where do you draw the line and how do you know when you have crossed it?  ', '', 0, ''),
(36, 'The Art of the Performer Bio', 'Do you find yourself in a panic when asked for a bio? Not sure what to say, or how much you should say? This class will introduce you to the genre of the performer bio, and provide a method for creating a stockpile of bios for various audiences – from festival producers, to fans, to potential bookers. The bio is a critical tool for performer’s self-presentation, and this class will instruct students on how to craft engaging biographies that maintain a consistent persona across multiple platforms. Bring a notebook and a pen.', '', 0, ''),
(37, 'Funky Fans: Going Beyond the Feathers', 'Feather fans are the beautiful, elegant epitome of classic burlesque in the minds of most laypeople. But one of neo-burlesque''s most engaging properties is the way it can transform the classic into the clever and creative. This class will introduce students to construction techniques for non-feather fans, so that they can learn to make fans out of anything from flowers to porno magazines to Christmas ornaments to human hair! The class will also consider adapting classic fan moves for non-feather fans, as well as a offer theories for creating engaging fan reveals with non-feather fans. This class will be taught in a demo and movement format - we won''t make any fans in class, but you will walk away knowing how to!', '', 0, ''),
(43, 'Flirty & Fit', '\r\nFirm and tone your entire body in this flirty and fun exercise class! Each class will include cardio and strengthening exercises that emphasize the physicality, flexibility and technique used by burlesque performers! Not a burlesque performer? That''s ok! This full body workout will firm and tone you in all the right places.\r\n\r\nParticipants should wear form fitting exercise clothes, comfortable shoes, and bring a towel and water bottle.', '', 0, ''),
(44, 'Ballet for Burlesque', 'Ballet for Burlesque is a Ballet technique barre-based course that focuses on balance, grace, and strength for the entire body using exercises pulled from the classical ballet repertoire. This course is taught by Matt Finish, former soloist with Les Ballets Trockadero de Monte Carlo.\r\n\r\nParticipants should wear form-fitting dance wear and ballet shoes.', '', 0, ''),
(47, 'Improvisational Character Development and Movement', 'using movement based improvisational techniques to strengthen the emotional and character aspects of Burlesque performances.\r\nClass would include movement based exercises as well as acting technique and performance coaching.', '', 0, ''),
(52, 'Stretch and Strength For Contortion', 'Can''t touch your toes? Can you put your feet over your head no problem? Either way, this class is definitely for you. Come get a deep thorough stretch with Chicago''s Creature Contortionista, Dahlia Fatale. She will also walk you though a bit of anatomy and how to use some of your new found bendiness for fun choreographed tricks.', '', 0, ''),
(53, 'Rock and Roll Chair', 'The top attended class from last year is back again! Chair are not just for sitting down. Bring out your inner rock and roll while learning chair dance moves that will surely wow an audience and make you feel great!', '', 0, ''),
(58, 'Neo dark cabaret', 'This is a Exotic combo class of Classical Burlesque meets Neo classic with theatrical cabaret moves, stage presence, With a dark edge Great for those who enjoy dancing to Other genres of music other then Classic and like to add Gothic or alternative styles to their repertoire ', '', 0, ''),
(60, 'Generic 12 step meeting', 'I have been to a bunch of festivals and Cons recently and, noticed they offer this. It is very helpful to have for performers who attend a 12 step program that are so wrapped up in the festival that they can''t leave to find a meeting. So I am proposing that we bring the meeting to them. Host it just like one of the classes and, it will be generic so it will be welcoming to all 12 step program followers.\r\n\r\nPlease if this class does get accepted please do not publish my name as I wish to be anonymous. It is the way the program works.  ', '', 0, ''),
(61, 'Pasties On The Cheap', 'Miss Bella La Blanc from Virginia for this special one-day/night-only work shop!\r\n\r\nBella''s workshop will show performers of all levels how to construct a pastie with different kinds of fabrics and materials so all budgets are met!\r\n\r\nBella will also show students how to make and keep permanent patterns for you nipple shape as well how to make unique shapes and patterns such as stars, hearts, etc!\r\n\r\nOf course...there will be tassels! Bella''s class will be covering how to attach a removable tassel and even how to MAKE a tassel!\r\n', '', 0, ''),
(67, 'On Towards Greatness: Troupe Leadership Strategies', 'Do you ''rule'' your troupe with strict guidelines or is it more of a laissez-faire style? What types of written and/or legal documents - if any - do you require your members to sign and why?  What works and what just plain falls flat amongst leadership styles when managing a troupe full of burly ladies & gents? Come and hear what our panelists have to say about their many collective years of experience in managing successful troupes all across the country (and around the world)!', '', 0, ''),
(70, 'Clark Kent to Superman', 'This course will cover character development as a way of protecting your private life (wigs, make up, masks, personality, etc...) The importance of establishing an independent "performance" profile on Social media. Tips for protecting your private life from your performance persona, ways to keep tabs on and check up on your online presence. There will be a discussion portion where students can share tips and techniques, and a question & and answer portion. ', '', 0, ''),
(73, 'yoga for burlesque', 'Yoga is an essential exercise for strength flexibility and balance which are important elements of a performance dance and or routine. Come experience an introduction to various yoga postures a d then relish the relaxation of savasana.', '', 0, ''),
(77, 'Burlesque Hosting For Performers', 'Imagine this: \r\nYou''re surrounded by beautiful, strong, talented burlesque performers, and it''s your job to introduce each one of them to an eager crowd. As a performer, you understand the complexity of each act, but how do you prepare the audience for the show?\r\nIn this fun, interactive class, learn the steps to getting over public speaking anxiety, tightening transitions between each act, and bringing your own flair to the realm of burlesque hosting!', '', 0, ''),
(98, 'Keeping your Ecdysiast Books', '"I''m not in burlesque for the money." That''s fine, but, there is money involved, and we all need to keep track of it. \r\n\r\nClass topics will include opportunity costs, break even points, invoicing and what your accountant is looking for during tax season.\r\n\r\nTime permitting, advanced tax topics like depreciation and amortization will be covered.', '', 0, ''),
(99, 'Dancing in Shoes You Shouldn''t Be Walking In', 'This class will help you conquer your fear of (shoe) heights. We will  examine the natural motion of walking and adapt it to a graceful and powerful presence in high heels.', '', 0, ''),
(100, 'Handsewing 101: Fast and Easy Shimmy Belt Construction', 'In the process of introducing hand stitching technique, students will build their own simple shimmy belt. Topics will include proper selection of  needles, thread, and materials, as well as reinforcements, fasteners and a selection of basic stitches.', '', 0, ''),
(103, 'CABARRET, Fit. ', 'CABARRET is a unique combination of barre and burlesque, strength and cardio, with lots of stretching incorporated to give you an incredibly effective workout.\r\n\r\nA disciplined strength training program combined with sexy cardio dance workout is FUN! Work at the barre translates to toned thighs, a sexy booty, tight abs and sculpted arms. Our cardio burlesque dance burns fat and calories.\r\n\r\nIn CABARRET, we celebrate our body. You leave each class empowered and centered, with strength and sass!\r\n\r\nPerfect for women seeking to use burlesque in fitness, or for empowerment!', '', 0, ''),
(104, 'CABARRET Teacher Training', 'Perfect for burlesque dancers who are fitness or dance instructors! Provides a  legitimate, ACE (American Council on Exercise)-approved certificate and Continuing Education Credits. \r\n\r\nCABARRET is a unique combination of barre and burlesque, strength and cardio, with lots of stretching incorporated to give you an incredibly effective workout.\r\n\r\nA disciplined strength training program combined with sexy cardio dance workout is FUN! Work at the barre translates to toned thighs, a sexy booty, tight abs and sculpted arms. Our cardio burlesque dance burns fat and calories.\r\n\r\nIn CABARRET, we celebrate our body. You leave each class empowered and centered, with strength and sass!\r\n\r\nIn order to cover the entirety of the Teacher Training Curriculum, this class would have to be spread over all 3 days, with participants attending every session. While more than a usual conference workshop, this Teacher Training gives students the credentials and experience to leave a make money with the burlesque background. ', '', 0, ''),
(105, 'Ballet for NonDancers', 'Former professional ballet and modern dancer CoCo LeBod leads you through a movement session meant to make the graceful, elegant movements of ballet accessible, even to non-dancers!\r\n\r\nGreat technique refresher for experienced dancers as well!', '', 0, ''),
(109, 'Synchronized Swimming: Burlesque for Mermaids!', 'A brief history of the sport of synchronized swimming will be given, from water shows, to Esther Williams, to its emergence as an Olympic Sport. Particular emphasis will be given to the costume and make-up choices of exceptional competitors and how to use these choices to inform burlesque routines. Students will then be given the opportunity to learn an actual synchronized swimming routine from the pool of the official Exposition hotel, the Hyatt Regency. Simple movements will be incorporated that will develop strength, poise, and will expand any physical fitness routine, regardless of body size or prior athletic ability. ', '', 0, '');
