INSERT INTO `gbe_performer` (`id`, `contact_id`, `name`, `homepage`, `bio`, `experience`, `awards`, `promo_image`, `festivals`) VALUES
(1, 1, 'Betty Blaize', 'http://www.bostonbabydolls.net/', 'Betty has been doing this too long.', 10, 'Critically acclaimed in every newspaper in Boston.', 'uploads/images/Betty_Smile_2_1.jpg', ''),
(2, 2, 'Scratch', 'http://www.BostonBabydolls.com/', 'The Founding Chair of The Great Burlesque Exposition and the co-founder of The Boston Babydolls, Scratch is a well-known and well-respected M.C., producer, and instructor.', 10, 'As producer of The Boston Babydolls, Scratch has been pleased to receive accolades for "Best Burlesque", "Best Dance Troupe", and "Best Theater Troupe" from a wide variety of publications.', 'uploads/images/Scratch_-_MCing_4_1.jpg', ''),
(5, 6, 'Miss Mina Murray', 'http://minamurray.com/', 'Co-founder of The Boston Babydolls and Headmistress of The Boston Academy of Burlesque Education.', 10, '', 'uploads/images/Miss_Mina_Murray.jpeg', ''),
(6, 8, 'Dee Dee Perks', 'http://www.facebook.com/deedee.perks.1', '"The Double-D MVP of LA Variety"\r\n\r\nDee Dee has been dancing since she was 3 years old...and has mastered everything from Ballet to Ballroom to Belly Dance! Her playful, theatrical spirit and dazzling prop work brought her to Burlesque, and she blossomed into an all-around Variety Performer, specializing in Hula Hoops, Fire and Novelty Acts. With her bright smile and perky perks, Dee Dee delivers sexy, daring, athletic performances that keep you on the edge of your seat!', 4, 'Dee Dee was recently featured on NBC''s "Hollywood Reporter" performing her Hooplesque with Freak Show Deluxe. And she performed at the Hollywood Burlesque Festival in 2013. ', 'uploads/images/Ashley_Fire_Clown_Town_Empire_1.jpg', ''),
(7, 7, 'Trixie Santiago', 'http://www.trixiesantiago.com/', 'Raised on a steady diet of classic musicals and golden age science fiction, Trixie Santiago combines elegance and a sense of limitless possibilities. Inhabiting the space between yesterday and tomorrow, dress and undress, dreams and reality, she brings audiences along on a journey of ecdysiac transformation. \r\n\r\nA newcomer to the Boston burlesque scene, Trixie made her burlesque debut at the "Boston Loves Dixie" fundraiser for Dixie Evans. She has performed at Rogue Burlesque''s "Lucky 13" amateur burlesque competition, the Newcomers'' Showcase at the 2014 Great Burlesque Exposition, and the Royal Court''s New Talent Showcase.', 1, 'none', '', ''),
(8, 9, 'Diviana Devour', 'http://www.divanadevour.com/', '\r\n\r\n***** THE DARK ROSE ******\r\n\r\nAlso been dubbed; The Gothic Jessika Rabbit, (True red head with curves) performs Neo Burlesque with an avant garde appeal(Coffins, Black snakes and Post punk-Goth-Psycho Punk music infused) and The Vampiress of belly Dance.......\r\n\r\nMODEL * BURLESQUE/BELLY DANCE PERFORMANCE * POET * HOSTESS * SPOKEN WORD/SONGTRESS * - DESIGNER *\r\n\r\n*Born into a family of professional performers, Dad a world renowned Escape artist-Illusionist , Burlesque performer Mother. Grandfather a Opera singer. Diviana Devour is a natural born multifaceted-talented Model-performer. With over 2 decades as a professional Pinup/Promo Model, Dancer/Singer in the Punk-Gothic-Metal genres and scene throughout the East coast. With Performances throughout the East Coast US and Overseas(Denmark, Venezuela, Morocco). Published model in nationwide Glamour-Car-Bike-Fetish and Retro magazines, 75 web zines-sites. And featured Burlesque-Belly Dance performer.\r\n\r\n* hosted/Promoted/Vended and performed with her own Gothic-Metal night AVANT GARDE DARK LOUNGE , Hostess on VAMPYRE LOUNGE TV - MC for THE BLACK SUN FESTIVAL. From 2005-2008\r\n\r\nPublished first book of written works"CRYPT MYSTRESS" in March 2007 by Lulu Publishing\r\n\r\n* She was also a featured Dark Cabaret performer with Raq Spooky, Shimmies for the cure , and her own showcase Fusion Fest at Mehanata''s in the East Village NYC.... etc...\r\n\r\n*She created her own style of Dark cabaret " ROCK SHAKI" Belly dance to Middle Eastern Metal/Goth music. 2006. I am also a certified GODDESS WORKOUT INSTRUCTOR (burlesque-Belly dance Cardio).Also designs Burlesque-Belly dance costumes-stage wear, PUNK*GOTH Collectibles etc...\r\n\r\n* She is now working on several Projects Neo-Burlesque showcase "Thornz N Rosez", Dark Belly Dance Showcase DARQUE RAQS, writing my second poetry book, and forming a new band for the fall of 2014.\r\n', 20, '\r\n\r\n\r\n\r\n\r\nPAST SHOWS AND PERFORMANCES:\r\n\r\nBurlesque:\r\n\r\nNight Clubs/Theaters:\r\nHammerjacks NJ - 1985-1989\r\nThe Limelight NYC - 1985-1998\r\nThe Palladium NYC - 1987-1989\r\nLizmor Lounge NYC -1987-1989\r\nZone DK NYC -1987-1989\r\nLamours NY 1987-1998\r\nShow world- NYC 1990-1995 years in a row as a featured burlesque performer.\r\nHarmony theater - NYC -burlesque performer from 1991 to 1996\r\nLegs Diamond NYC owned by Jocelyn former Harmony theater performer - 2 years\r\nThe Blue Angel theater NYC\r\nThe original BAT-owned by Uta a former harmony theater performer. NYC - 1995-1998\r\nI performed for Demi Moore and her husband Bruce willis\r\nThe cupping Room NYC- 2000\r\n\r\nBelly Dance\r\nAlmira F Stephan Memorial playhouse - Meriden, CT 2006\r\nWebster Theater - Hartford CT Guest singer with Tracy Guns\r\nThe Regent Theater - Arlington MA, 2006/2007 . 3 years in a row as a Dark Cabaret Belly dancer.\r\nWebster Theater - CT 2008\r\nCabaret Curiosa at Club Faust - Copenhagen, DK - Featured performer - 3 shows November 28/29th 2008 - Burlesque,\r\nDark cabaret and backup dancer for Dannish Gothic/Electro performance artist Ras Bolding.\r\nThe Great Boston Burlesque Exposition -Boston Mass. Sunday April 24th 2011-8 PM - The Hyatt Regency Cambridge (575 Memorial Drive, Cambridge, MA). , <a href="http://www.Burlesque-Expo.com/">www.Burlesque-Expo.com</a> <a href="http://www.burlesque-expo.com/">http://www.burlesque-expo.com/</a>\r\n\r\nI hosted my own Event THORNZ N ROSEZ BURLESQUE and BELLY FUSION FEST! in NYC 2010..\r\n\r\nVisionary Tattoo Arts Festival', '', ''),
(9, 11, 'D. FAUST', 'http://www.777DELACROIX777.COM/', 'Fabienne Giselle Delacroix, also known as D. FAUST, is a Burlesque inspired performance artist, creative visionary, YouTube blogger and sorceress of the Left Hand Path. She has been dragging souls to hell since 2008. Of Brasilian and Creole lineage, she is a "stage witch" and is known for creating supernatural and subliminally layered atmospheres within the medium of Burlesque.\r\n\r\nAs seen in Curve Magazine, Alt Variety Magazine, Cult Sirens, and Afro Punk Tour 2009.', 5, '', 'uploads/images/dfaust.jpg', ''),
(10, 10, 'Eva Angel', 'http://thegartergirls.com/', 'Ms. Angels'' passion for burlesque is born from her main loves in life: dance, lingerie, and artistic expression. From these entities, a passion was created and continues to thrive within this Canadian Angel with Attitude as she performs with both of her Calgary-based sparkle families, The Garter Girls and Fake Mustache Drag King Troupe!', 4, 'Calgary Burlesque Festival 2014', 'uploads/images/DSC_6476_1.jpg', ''),
(11, 12, 'Doctor Vu', 'https://www.facebook.com/thedoctorvu', 'Doctor Vu has been making audiences stop blinking and start proclaiming "Oh, yes!" as a Sugar Shaker with the Green Mountain Cabaret since 2012. Trained in mask work and physicality, she has has been acting for several years in classic theatrical productions, Commedia dell''Arte and Interactive Theatre along with producing and directing "The Taming of the Shrew" in 2008. The Doctor also teaches dance fitness classes that embrace the idea  that all shapes and sizes can be fit and have fun through dance.', 2, '', 'uploads/images/doctor_vu.jpg', ''),
(12, 13, 'Selia d''Katzmeow', '', 'Selia d’Katzmeow Carmichael is a burlesque artist hailing from the heart of North Carolina by way of her authentic Gypsy roots. \r\n\r\nd’Katzmeow performs all over the USA with international traveling performance artists, satisfying her primal needs to keep it movin’ and shakin’! She has ben chosen for and participated in several burlesque festivals and continues to make traveling for inspiration her aspiration.\r\n\r\nSelia d''Katzmeow is the creator and producer of the first and longest-running monthly Burlesk Revue in NC. She has performed in three Fringe Festivals, producing two of the shows. She is the producer of Heavy Rebel Weekender''s ''WIGGLE ROOM,'' BULL CITY RUMBLE''s burlesque, and co-founder of CAROLINA BURLESQUE FESTIVAL.’ \r\n\r\n', 8, '', 'uploads/images/selia.jpg', ''),
(13, 14, 'Belboz The Magnificent', 'http://www.belboz.com/', 'Born in Red Hook, Brooklyn, in the year of who knows when\r\n', 4, '', '', ''),
(14, 15, 'Lily Stitches', 'https://www.facebook.com/pages/Lily-Stitches/82022871336', 'Lily Stitches has been performing burlesque for more than 7 years. She has toured along the East Coast, performing in Boston, Philadelphia, New York City, Baltimore, Washington DC, Richmond, and more. In May she co-produced a successful run of her show Stripelodeon. She is the host and veteran performer of The Ink & Paint Club Burlesque. ', 7, 'Performed at the Boston Burlesque Expo in 2013\r\nHeadlined the New Jersey Burlesque Festival in 2014', 'uploads/images/Final-01.jpg', ''),
(15, 16, 'Maggie McMuffin', 'https://www.facebook.com/McMuffinBurlesque', '\r\nMaggie McMuffin got her start in the not so wilds of Montana, performing in cabarets and earning a Bachelor of Fine Arts in Theatre. After years of combining nudity with other theatrical genres, Maggie started burlesquing in 2010. In 2013 she headed for Seattle, quickly finding a home among the growing Nerdlesque community. Drawing inspiration from past and present pop culture, Maggie creates dynamic performances that run the gamut from silly to sultry, hilarious to heart wrenching. Known as The Pelvis of Justice, she''s here to hip-thrust her way into your heart.', 3, '', 'uploads/images/Maggie_McMuffin.jpg', ''),
(16, 22, 'Ginge O''lolly', 'https://www.facebook.com/ginge.ololly', '"Dance like no one is watching." These are the words one of the newest Sugar Shakers, Ginge O''Lolly, thinks every time she takes to the stage. This previous stage kat used to watch in jaw-dropping astonishment as her burlesque sisters and brothers mesmerized the audience with their skin-tilating ways. Taking it all in, and adding her own "ginger-ness" to her dances, she''s sure to warm you up with all her spice.\r\n\r\nGinge is also known for making fantastic pasties and helping out with costuming for her burlesque family. She is always looking for fun new crafts to turn into amazing pieces for you all to enjoy! Oh, and she may have a few tricks up her sleeve...', 2, '', 'uploads/images/034.jpg', ''),
(17, 23, 'Mona del Rio', '', 'Mona del Rio encompasses her latin roots and upbringing in her burlesque style. Her unique approach to culture brings out a passion and sexuality that people may fail to see. Mona encourages all to embrace their heritage abundantly and enthusiastically. ', 7, 'Colorado Burlesque Festival; Carolina Burlesque Festival; Oklahoma Burlesque Festival; ', 'uploads/images/aztec.jpg', ''),
(18, 25, 'Laika Fox', 'http://laikafox.com/', 'Laika Fox is an Oakland-based neo-burlesque performance artist, and has been wooing audiences to the moon and back since 2010. Her work is clever, insightful, and often subversive.', 4, '', 'uploads/images/Laika_Fox.jpg', ''),
(19, 27, 'Scandal from Bohemia', 'http://jacquelinehyde.com/web/scandal-from-bohemia/', 'Scandal from Bohemia, the Weapon of Ass Destruction, has been getting ridiculously naked or nakedly ridiculous since 2007. ┬áSince then, she has performed in the United States, Canada, France, and Italy as well as being named Most Humorous in 2010′s Great Burlesque Expo in Boston. ┬áWhether her acts involve ten foot long stuffed snakes, tomato soup can shimmy belts, or inappropriately placed bologna, audiences will leave shows understanding that Naked Is Funny.', 7, 'Most Humorous, Great Burlesque Expo, 2010', 'uploads/images/1689467_10152817254979552_1941604391761778698_n.jpg', ''),
(20, 30, 'Scarlett Letter', 'http://Scarlettletterburlesque.com/', 'Scarlett Letter has been dazzling the world since 2004 and stunning them even longer. Besides performing all over Southern California, she has been seen across North America and  Europe. Awarded burlesque titles at The Great Burlesque Exposition and The Great Southern Exposure, she is also an award winning costumer and choreographer. Scarlett currently co-produces Peepshow Menagerie and The Naked Show (and Tell). Red hair, a vintage flair and very calculating feet are her calling cards. ', 10, '2007 - Most Classic GBBE\r\n2010 - Best Soloist, Legend''s Choice - GBE\r\n2012 - Most Glamorous - GSE\r\n2013 - Best Lypsinc - Burlypicks\r\n2014 - Best Tassels - California Regional Burlypicks', 'uploads/images/Scarlett_Letter_lr1.jpg', ''),
(21, 31, 'Clara Coquette', 'http://www.claracoquette.com/', 'Clara Coquette is a New York based burlesque performer, stage kitten, go-go dancer, and model that was born and raised in Detroit, Michigan.  She is a vintage vixen, a nimble nerd, and a cunning chameleon.  She moved to New York in 2009 and stumbled upon the glamorous, glittery, and geeky world of burlesque.  She has trained at the New York School of Burlesque under Jo "Boobs" Weldon, Gal Friday, Peekaboo Pointe, Helen Pontani, and visiting teachers Lola Frost, Indigo Blue, Michelle L''Amour, and Marinka.  Clara made her performing debut in 2011 and has been balancing burlesque with her full time career in medical science research ever since.  Born out of a test tube of sparkle and spunk, the delicate darling of beakers and bunsen burners.  She''ll transport you back in time, the Clara Bow of Burlesque: Clara Coquette.', 3, '', 'uploads/images/_MG_1306b.jpg', ''),
(22, 32, 'Red Velvet', 'http://www.redvelvetburlesque.com/', 'Red Velvet is a life-long dancer, began studying dance at the age of 2.  Proficient in tap, ballet, and jazz, Red Velvet continues to study new forms of dance such as samba and flamenco.  Ms. Velvet began intensively studying Isadora Duncan dance in 1999, and began studying burlesque in 2008 with Bombshell Betty.  Red Velvet has performed extensively in musical theatre, performed throughout California, has studied and performed dance in New York, and has toured internationally.  She has taught dance to adults and children, including training and teaching children to perform in professional musical theatre events.  Ms. Velvet currently performs Isadora Duncan dance, she has performed with the Hot Pink Feathers, Bombshell Betty’s Burlesqueteers, and Alegria Samba Dance Company.  Red Velvet is also a prolific choreographer and can frequently be seen performing solo work at the Elbo Room in San Francisco and at many shows around the Bay Area.  She is a co-artistic director of the \r\n“DIVA or Die” burlesque show (a production of DIVAfest) at the Exit Theatre, and the co-creator of the burlesque play “Rebel Without a Bra: A Burlesque Cabaret” which was presented as part of DIVAfest 2013.   She is currently working on a new burlesque/theatrical production, At The White Rabbit Burlesque, which will debut in May 2014.  Ms. Velvet has performed solo acts at the Texas Burlesque Festival, the Ohio Burlesque Festival, the Hollywood Burlesque Festival, the Carolina Burlesque Festival, The Great Burlesque Expo in Boston, and Girlesque 2014! in Toronto, Canada.  Her act won "Most Humorous" at the Great Burlesque Expo 2014!  \r\n\r\nRed Velvet currently teaches Can-can classes and co-teaches burlesque classes at Bombshell Betty''s Burkesqueteers.', 6, 'Howard Award - 2014, most humorous', 'uploads/images/image.jpg', ''),
(23, 33, 'Cherie Nuit', 'http://www.cherienuit.com/', 'Creeping out of the darkness, hailing from the mystical land of Baltimore, comes the comedic assailant of ennui; the girl who''s weird in all the best ways!\r\n\r\nA protege of the boundary-pushing Paco Fish and graduate of the Gilded Lily School of Burlesque, Cherie now finds herself as a a local favorite in the DC/Baltimore area as well as a co-producer of Hot Night Productions, the show where bump-and-grind meets blow-your-mind!\r\n\r\nAs if producing wasn''t enough, Cherie is also a co-founder of Baltimore''s newest burlesque troupe Bawdy Shop Burlesque. With her fellow Bawdies, they bring an uncompromising commitment to their work. Nothing is half-assed... it''s full-assed or nothing!\r\n\r\nNothing can stop this vivacious and curvaceous bad-ass as she makes her way across the country! An award winner in the Great Southern Exposure 2012''s Best Group Category, Cherie can be found anywhere from the 2014 Alterna-Tease Festival, 2014 Great Burlesque Exposition, the Modell Lyric Opera House, The DC and Baltimore Fringe Festivals, to even a dive bar in the heart of Baltimore (her favorite!). Having worked with modern legends such as Dr. Lucky, Lux LaCroix, Trixie Little and the Evil Hate Monkey, Mr. Gorgeous, Paco Fish, Darlinda Just Darlinda, Gin Minsky, Lola Frost and many others, Cherie is proud to call the world-wide burlesque community her second family! \r\n\r\nDC''s Brightest Young Things says "This rising star in the DC/MD/VA Burlesque scene is one saucy siren that is constantly cooking up something new! She has a unique and unstoppable energy, and leaves it all on the stage when she performs!" Audiences, you''re not ready for this. Bringing light to the darkness, it''s Chérie Nuit, Baltimore''s darling of the night.', 3, '2012 Great Southern Exposure''s Best Group\r\n2014 Queen of Crabs Nominee ', 'uploads/images/CHERIE_NUIT.jpg', ''),
(24, 35, 'Dahlia Fatale', 'http://www.dahliafatale.com/', 'Dahlia Fatale is a contortionist, dancer, burlesque artist, and instructor in Chicago. She love to perform for a wide variety of audiences bringing a mix of circus, tease, and power to the stage in the form of personal, strong, entertaining characters.', 5, 'Master of Improv-Chicago Burlypics\r\nFeatured Artist- Chicago Innovation Awards\r\n', 'uploads/images/2014-06-04_CHB_Sip_N_Strip_0669.jpg', ''),
(25, 37, 'Raven Gemini', 'http://www.ravengemini.com/', 'Raven Gemini is a chameleonic storyteller specializing in character-driven burlesque performance. No common crow, she portrays a wide range of characters from the sweet to the strange, the delightful to the deranged. She has been a proud member of Vaudezilla since 2012. ', 3, 'Festival appearances:\r\nWindy City Burlesque Festival: 2012, 2014\r\nGreat Burlesque Exposition: 2014\r\nMichigan Burlesque Festival: 2014', 'uploads/images/2077_041.jpg', ''),
(26, 38, 'Dottie Dynamo', 'http://www.dottiedynamo.com/', '\r\nDottie is a New York City based Burlesque performer and is an associate producer of Shaken & Stirred. She has performed at many NYC venues and has had the honor of performing at the Toronoto, Boston, Arizona and Texas Burlesque Festivals.\r\n \r\nDottie began her burlesque career in 2011. Known for being an energetic powerhouse she performs mostly classical styled acts with a lot of bump and grind. The girl that is quickly winning over the hearts of everyone in the crowd may be sweet but she''s no stranger to mischievous antics. After all, Dottie Dynamo is The Lovable Bundle of Tits N'' Trouble.', 4, 'Performed at Great Burlesque Expo 2014, Texas Burlesque Festival 2014, Arizona Burlesque Festival 2014, Toronto Burlesque Festival 2013', 'uploads/images/Dottie_Dynamo_by_Harry_Poicius_2014.jpg', ''),
(27, 26, 'Vivi Vendetta', '', 'Growing up as a tenacious tomboy, little Vivi was just one of the guys. She traded traditional female activities for martial arts and weapons training. An alluring enigma of beauty and adventure, she loves to flirt with danger while looking damn hot. Delighting in performing new teases, Vivi is out for vengeance as a strong, beautiful, vivacious vixen, who won''t stop until she''s on top. Upon her burlesque discovery, this devious darling prides herself in being a mischief apprentice/burlesque believer at Delinquent Debutantes, a Music City Burlesque finishing school in Nashville. Her feminine wiles aim to make you shiver in your seat. This maniacal minx wants to go all the way, proving revenge is a dish best served topless.', 0, '', '', ''),
(28, 40, 'Elyse', '', 'Your friendly Teaseday stage kitten and B.A.B.E. graduate.', 1, '', '', ''),
(29, 44, 'Chakra Tease', 'http://www.chakra-tease.com/', 'Chakra Tease, whose favorite philosopher is Socrates, has been a VaVaVette, with Cora Vette and the VaVaVettes since 2012. The VaVaVettes performed at Harrah''s for Viva Las Vegas Rockabilly Weekend and at the House of Blues for the New Orleans Burlesque Festival. Locally Chakra performs with RestoMod Burlesque, which was voted Best Burlesque Night by Westword Magazine. She has also been a guest performer for the Follies VouDou at the VooDoo Comedy Play House. She has performed at the Colorado Burlesque festival for the past two years and was a soloist at the Ohio Burlesque Festival in 2013. In August of 2014 she choreographed as well as performed in D''Sanez Productions "Feel This Moment" at the Reserve Casino in Blackhawk, Colorado. Most recently she was a finalist in the 2014 California Regional Burlypicks Competition.  \r\n', 3, 'Burlypicks California Regionals Finalist', 'uploads/images/Burlypicks2.jpg', ''),
(30, 42, 'Cherie Fluster', '', 'I', 2, '', '', ''),
(31, 47, 'Sailor St. Claire', 'http://www.sailorstclaire.com/', 'Sailor St. Claire is a curvaceous redhead with learned mind and an A+ anatomy. With her scintillating wit and copious charms, Sailor channels academic excellence into burlesque bravura.  Since 2009, The Showgirl Scholar has been putting her knowledge of the literary canon to more-than-scholarly uses, crafting elegant and erudite stripteases that offer audiences an education in the humanitease.\r\n\r\nSailor performs with Sinner Saint Burlesque and co-produces Naked Girls Reading - Seattle. She is also the producer of Tuesday Tease, Seattle''s only monthly burlesque revue at LUCID featuring live musical accompaniment by Pervana.\r\n\r\nSailor can also be found as a soloist on stages throughout Seattle, and makes regular trips to San Francisco to appear at the (in)famous Hubba Hubba Revue, Little Minsky''s, and Red Hots Burlesque. She also frequently performs in Portland, OR, and has appeared internationally at Kitty Nights West at the Biltmore Cabaret in Vancouver, British Columbia and in the UK at Gutter Lane at Edinburgh’s Jekyll & Hyde Pub. She has been featured at the Ohio Burlesque Festival, the Alabama Burlesque Festival, the Great Southern Exposure Burlesque & Variety Pageant, and the Great Burlesque Exposition in Boston, where she was awarded the 2014 Legend’s Choice award by April March, The First Lady of Burlesque.', 6, 'Legend''s Choice 2014 - GBE14', 'uploads/images/170NoWMHR.jpg', ''),
(32, 43, 'Serendipity Love', 'https://www.facebook.com/pages/Serendipity-Love/189468644428219', 'Serendipity Love got her first exposure to the burlesque community in Atlanta GA seeing shows produced by the Syrens of the South and the Southern Fried Burlesque Festival and has been in love ever since. She first studied in Trixie Lane''s Kindergarten of Burlesque in Seattle, WA, where she performed her debut act "Candy Girl Did a Bad Bad Thing. She continued her training with Deanna Danger in Richmond, VA in her burlesque concepts workshop and performed her second act "Killer Queen" in Deanna''s 2012 student recital and was afterward featured in a local RVA online magazine.\r\nSerendipity is also a belly dancer specializing in Cabaret and Tribal Fusion styles and is a member of Lawton''s premier belly dance troupe, Obscura Dance Co.\r\nMost recently Serendipity has performed in Tulsa at Shake It - Dance and Fitness Studio Rhinestone Round-Up Burlesque and Variety show and competed for Burlesque Queen of the Heartland 2014 in Tulsa''s very first Burlesque Festival; Pasties 4 Paws, a Pink Peacock Production.', 3, '2014 "Pasties 4 Paws" Burlesque Queen of the Heartland Contestant', 'uploads/images/IMG_0036-2.jpg', ''),
(33, 36, 'Mercury Stardust', 'http://www.chezbouche.com/', 'With over a decade of performance, light design, puppeteering, dance, comedy and clowning under his belt he has turned to boylesque.  He combines all of his experience in one high energy number each time he steps on the stage.  Mercury performed with the travelING cabaret show Chez Bouche'' for 4 years and now is pursuing a solo career.', 4, '', 'uploads/images/LLP_20140516_214904.jpg', ''),
(34, 48, 'Nissa Citrine', 'https://www.facebook.com/nissa.citrine', 'Nissa Citrine is often mistaken for your classic girl next door-didn''t your mama ever tell you that it''s the quiet ones you should watch out for?! Evoking a darker vintage pin-up edge by drawing from her goth/metal roots, nerdy interests and wholesome love for all things crafty and domestic, Nissa has brought her own brand of DOOMestic burlesque since her September 2012 amateur debut. ', 2, 'I am a previous GBE performer, I have also recently traveled to perform for the Fierce!:International Queer Burlesque Festival.', '', ''),
(35, 49, 'Vivian Vice ', 'https://www.facebook.com/vivian.vice.9', 'Vivian Vice, Burlesque Queen Belly Dance Dream, is a classic burlesque and belly dancer performing since 2003. She was a co founder of Portland Maine''s first burlesque company Whistlebait Burlesque with Jolene Divine. Also a practicing pin up model, Vivian was Featured in Bela Morte and Alt Girl magazine''s burlesque edition  Vivian has performed as Whistlebait Burlesque and as a solo artist with many well known acts such as Angie Pontani, The Pontani Sisters, Kitten Deville, the Boston Baby Dolls,  Cha Cha Velour, and Princess Farhana.  A highlight of Vivian''s burlesque career was meeting and sharing the stage with burlesque legend Tempest Storm.\r\nVivian Vice is known for her vintage style, class, grace and sweet persona while specializes in bumps,grinds and amazing shimmies!\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n', 10, 'Whistlebait Burlesque won Portland''s Best Dance Performer 2010- 2012 of the Portland Phoenix Best Readers Poll ', 'uploads/images/c2.jpg', ''),
(36, 50, 'Matt Finish', 'http://www.facebook.com/xoMattFinish', 'Matt Finish is a co-producer of Tucson, AZ''s Don''t Blink Burlesque and the Arizona Burlesque Festival. He took home Best Burlesque and the Master of Assels at the 2014 BurlyPicks International Finals.', 3, 'Best Burlesque, 2014 BurlyPicks International Finals\r\nMaster of Assels, 2014 BurlyPicks International Finals\r\nBest Improv, 2014 BurlyPicks New Mexico Regionals\r\nMaster of Assels, 2014 BurlyPicks New Mexico Regionals\r\nMost Comedic, 2013 Hollywood Burlesque Festival\r\nPrincess of A Peel, 2013 Iowa Burlesque Festival', 'uploads/images/Matt_Finish_2.jpg', ''),
(37, 52, 'Joy Va Voi', 'https://www.facebook.com/pages/Joy-Va-Vo%C3%AF/300236700024254?ref=hl', 'Trained in ballet since her early childhood and captivated by the beauty of female imagery, it was very natural for artist Joy Va Voï to move towards the art of strip-tease and its multifaceted forms.\r\n\r\nJoy Va Voï graduated in 2009 from the Ecole Supérieure de Burlesque in Paris, founded by American glamour enthusiast Gentry de Paris. Enthralled by classic burlesque performers from the thirties and forties, each of her performances are undoubtedly inspired by this era as she weaves their respected ingenuity into her own innovations.\r\n\r\nJoy Va Voï has collaborated with several burlesque organizations all over Europe (Neo Retro, Garter & Garter, Vaudeville company, the Lettingo Cabaret, Star Spettacoliamo ...), allowing her to fully understand the art from multiple, international perspectives and explore the depths of France, Italy, Belgium and Switzerland.\r\n\r\nSince January 2013, Joy Va Voï moved from the old continent to California in order to get closer to the burlesque legends and learn from the best in the business. She now travels through the US and had the pleasure to perform in Hollywood, San Francisco, Las Vegas, Atlanta, Denver and Chicago, working among incredible artists!\r\n\r\nSophisticated and full of surprises, this enchanting vixen is a real tease.', 4, 'Part of Stripathon in Las Vegas, a benefit for the BHoF in April 2014 \r\n\r\nAnd the 5th Annual Colorado Burlesque Festival in Denver', 'uploads/images/unnamed.png', ''),
(38, 53, 'Roman and Jennifer', 'http://romandjenniferdanc.wix.com/romanandjennifer', 'Roman and Jennifer are former professional Ballroom Dance instructors and Competitors, they were regional professional finalists in Theater Arts (OH and TX 2012, 2013), Open Smooth (2013) Closed Smooth (2012) Open Rhythm (2012), International Standard (2013), and Mixed Novice (2012), as well as numerous awards won with their students in pro/am competition. \r\n \r\nThey have spent the past several years combining dance styles such as ballroom, with contemporary ballet, dark jazz, tribal, and Japanese Butoh, to create their own unique dance style, danced by no one else. Entirely improvisational, their dance transcends labels and has become voyeuristic performance art.\r\n \r\nThey have performed professionally throughout OH, being featured dancers with The Rick Brunetto Big Band, as well as The Otterbein Symphony. They have been featured as solo dancers at the Urban Garden Room in NY and at events like the Columbus Italian festival, Columbus Arts Festival, Dublin Irish Festival, Cleveland Fashion GlamJam and many more.\r\n \r\nBeing no less active then in dancing, they are also prolific painters, photographers and art models. Their work have been featured in a number of magazines, journals and exhibitions.', 2, ' regional professional finalists in Theater Arts (OH and TX 2012, 2013), Open Smooth (2013) Closed Smooth (2012) Open Rhythm (2012), International Standard (2013), and Mixed Novice (2012), as well as numerous awards won with their students in pro/am competition. ', 'uploads/images/jim5.jpg', ''),
(39, 46, 'Sara Dipity', 'http://www.songbirdandraven.com/', 'Sara Dipity is Seattle’s own Shirley Temple with Tits. She’s part small town gal, part big city babe, and performance art flows in her veins. As a kid, she had the opportunity to sing alongside Johnny Cash, and also at mass in Vatican City. In 2008, she performed in Musical of Musicals: The Musical as a part of the American College Theatre Festival at the Kennedy Center, and later that year graduated with a bachelor’s in Musical Theater. Sara isn''t just a songbird—she dances, acts, improvises, and plays the ukulele, too. Sara joined the Seattle burlesque scene in 2011 and has performed with Jo Jo Stiletto Events, Sailor St. Claire Presents, Unnatural Redhead Productions, and many other theater and and burlesque production companies. She is also the lead vocalist at Tuesday Tease, Seattle’s only monthly burlesque revue with live musical accompaniment. Additionally, she lends her artistic vision to Songbird & Raven, a burlesque and theater production company she founded with her partner, Jacob Farley. Songbird & Raven (in association with Bunny Von Bunsmore) hosts Tassel Talk, a monthly development workshop for burlesque performers at all levels of experience. And recently Songbird & Raven celebrated sold-out success with their burlesque narrative, Star Trek: The Sexed Generation.', 3, '', 'uploads/images/DSC5994.jpg', ''),
(40, 54, 'Auralie Wilde', 'http://facebook.com/auralie.wilde', 'Educated at a quaint university in the cornfields of Iowa, Auralie Wilde grew up in an affluent Midwestern family. Active in the dance and musical theatre community, she tittilated audiences as the bubbly, virginal star of the show.\r\n\r\nWorldly and well educated, Auralie is known for her sharp tongue and quick wit. What her teachers didn''t know was that while they were admiring the shiny red apple she had given them, Miss Wilde was perfecting the art of the tease.\r\n\r\nGiving up her corn palace and Pork Princess title, Auralie Wilde decided to follow her grittier side to concrete pastures. She sold her sense of propriety for a one way ticket to New York City and hasn''t looked back.', 4, 'Burlesque Idol Winner October 2014', 'uploads/images/AuralieWilde.jpg', ''),
(41, 57, 'Shimmy LaRoux', '', 'A Chicago burlesque performer and model since 2014, Shimmy LaRoux is your bad girl with good home training.  Bringing a combination of refined charm and exotic good looks, Shimmy is able to channel classic Hollywood, be playfully cheeky or serve fierce diva realness.', 1, '', '', ''),
(42, 59, 'KiKi Allure', '', 'This beauty comes from the far magical land called Baltimore. KiKi Allure has been putting the charm in charm city for 3 years now and has spread her talent across the country. She recently won the title of Burlypicks DC Master of Tassels and competed in Hollywood. KiKi loves to to take the familiar and twist it then twerk it to make it all her own.  KiKi Allure wants you to enjoy her class, sass and a whole lotta ass.\r\n', 3, 'Burlypicks DC Master of Tassels 2014\r\nWinner of Best Group, Great Southern Exposure 2013', 'uploads/images/TG10.jpg', ''),
(43, 62, 'Jezebel Vandersnatch', 'http://dollfacedames.com/blog2/jezebel-vandersnatch/', 'What do ya’ get if Mary Poppins were a madam? This broad right here, folks. Jezebel Vandersnatch, The Salacious Songbird, is shaped like a Coke bottle (you know, the good kind with real sugar from Mexico) & is a mouthful in more ways than one!  Maybe more like 2 or 3 mouthfuls. Aw, heck. Let’s just see how many mouths it takes!\r\n\r\nShe was born 2009 & was invited to join Tempting Tarts Burlesque troop fresh outta kindergarten. It wasn’t long until her bumps & grinds were accompanied by her ultimate passion… sangin’! Also, known (to herself) as the Jackie-O of all Trades™, she is constantly working on rounding out her experiences by gettin’ her hands in as many honey pots as possible… plays, musicals, benefits & (yes, even) children‘s theater. And recently, picked up a ukulele & a pair of taps shoes... stay tuned!', 5, '', 'uploads/images/Vandersnatch1.jpg', ''),
(44, 63, 'Shirley Rockafella', '', 'Started burlesque classes at B.A.B.E in March of 2014 and loving it.', 0, 'Not yet...', '', ''),
(45, 64, 'Varla Velour', 'https://www.facebook.com/varla.velour.7', 'Varla Velour: The Voluptuous Vixen of Burlesque\r\n\r\nInspired by the Queens of Burlesque, Varla springs forth from the celluloid of film noir - a femme fatale that will ensnare, enrapture and delight. \r\n\r\nVarla has performed at New York City’s premier Burlesque venue, The Slipper Room, in addition to downtown haunts like Nurse Bettie, and Brooklyn hot spots like Bizarre. Her classic style and mysterious allure are elevated by obscure vintage rhythms, and the decadence of her costuming.\r\n\r\nHer burlesque style is made up of equal parts thumping sex appeal, elegant classicism, and fiery Latin sensibilities. Inspired by her Latin heritage and a legacy of headstrong women, Varla toys with the audience and leaves them asking: does she want to bed me or kill me?       \r\n', 2, 'None yet!', 'uploads/images/_MG_1010b.jpg', ''),
(46, 66, 'Bella La Blanc', 'https://www.facebook.com/BellaLaBlanc81', 'Bella La Blanc is a 12 year burly-q veteran who fell in love with performance when she started singing and dancing at the age of 4 and was raised a musical theater kid who even chose to major in theater in her college years. She is a full time stay at home mom of 2 boys and housewife by day....and vixen of the stage and tease by night, which is how she received the title, "The Stepford Wife Gone Wild".\r\n\r\nDuring her career she has performed in The Southern Exposure pageant and won best group 2012 with Kubrilesque. She has also hit the stage at The Detroit Dirty Show, 1st Michigan Burlesque Festival ,showcased at The Great Southern Exposure Pageant in Charlotte, NC, (IDKE) International Drag King Community Extravaganza. Bella competed in The Main Event at The Great Burlesque Exposition in 2014. She just won Best Singer at the 2014 DC regional Burlypicks. She also Headlined The Spring Fling Burlesque Festival in MI. She will also performed this year at The Fierce International Queer Burlesque Festival. She will also be competing this yr in The Great Southern Exposure Burlesque Festival and Pageant!The House Wife Gone Wild, originally hails from Miami, Florida, but currently calls the state of Virginia home. You can catch her on stages or teaching everywhere on the East Coast...maybe your town soon!!\r\nTo keep up with her check out www.BellalaBlanc.com', 12, 'DC Burlypicks- Best Singer/Vocalist\r\nGreat Southern Exposure- Best Group with Kubrilesque', 'uploads/images/BellaasMelissandre.jpg', ''),
(47, 68, 'Midnight Joy', '', '\r\nRetired tap dancer, accomplished swing dancer and over all passionate about all kinds of dance, Midnight Joy had gotten swept up into burlesque, when a friend of hers formed the burlesque troupe Dem Damn Dames. Since going solo, she has enjoyed performing at various functions and events throughout Houston, including working with the Benefit Betties, Team Romel Productions, and Rocket Girl Burlesque. She has performed in various shows and festivals throughout the great US. She makes almost all of her costumes and has even tried her hand at producing shows. She is very crafty and has big plans for her future in burlesque. Whether it is a classic striptease with a hairy twist or she decides to rip her face off, Midnight Joy strives to be freaky and fantastic.\r\n', 3, '', 'uploads/images/553077_10151569686777409_1231344556_n.jpg', ''),
(48, 69, 'Dolly Debutante', 'http://dollydebutante.wix.com/dollydebutante', 'With a flappers moxie wrapped over a showgirl''s curves, Dolly Debutante has taken New York Burlesque Scene by storm.\r\nOperating near the classical end of neo-burlesque, Dolly embodies the elegance and razzmatazz of the last century, given a fresh form in the new. In Spring 2012, she began taking classes at the New York School of Burlesque. Since then, she has graced the stages of some of New York''s most coveted venues, including The Slipper Room, City Winery, The Metropolitan Room, and Nurse Bettie. As a featured performer, outstanding stage kitten or go-go gal, Dolly Debutante will always bring a smile to your face. She is a regular fixture in some of the best burlesque shows that New York has to offer, including Bedlam Burlesque, The Sophisticates, Debauchery and Wasabassco!', 2, '', 'uploads/images/DollyDebutante.jpg', ''),
(49, 71, 'Raven LaRoux', 'http://www.ravenlaroux.com/', 'Although Raven LaRoux can at times be refined, elegant, showing you shades of her former past as a ballerina, DON''T let that fool you! She is sassy, enticing, and oh-so-spicy! She will ALWAYS be sure to leave you mesmerized and tantalized! The perfect mix of ballerina, bad girl, and bombshell, Raven will always deliver an act that will leave you on the edge of your seat, breathless, and begging for more.  The Founder, Artistic Director, and Co-Producer of her troupe of fifteen lovelies, the Bodacious Bombshells of Sacramento, Miss LaRoux is a beyond busy burly gal who is always on the move! ', 3, '', 'uploads/images/Raven_LaRoux_Burlypicks_CA_submission_6.29.14.jpg', ''),
(50, 72, 'Hank E. Panky', 'http://www.facebook.com/HEPanky', 'Since 2012, Kansas City''s favorite Tom Cat has been charming the whiskers off of every tabby and minx that passes by. You can find Hank E. Panky prowling the back alleys and spraying audiences with his unique brand of Burlesque humor. Between singing and dancing, Hank is always happy to pick up a scrap of clothing here and there, but be ready... for every time he struts his stuff, you can hear the meows and hisses from every pussy...cat! Watch out when he takes the stage, kittens, because the fur will fly!\r\n', 5, '2014 recipient of the Byrd Production Physical Theater Scholarship', 'uploads/images/HankE_Panky1.jpg', ''),
(51, 74, 'voluptuous Vanessa vixen', '', 'Vvv is an old gal with a young spirit who is fairly new to burlesque. After talking a class with The Boston Academy of Burlesque Education she caught the BURLESQUE BUG, took another class,  was in the Newcomers Showcase last year and here she is again! Vanessa has also performed in the Teasday Club and was a stage kitten at the the 12th annual burlesque festivl''s Teaser Show and at Key West. florida burlesque and pole competition. \r\n', 1, 'N/a', 'uploads/images/2014-09-24_16.20.31-1.jpg', ''),
(52, 78, 'Lottie Ellington', '', 'Lottie has a unique style, comedic wit and a flair for the dramatic; she revels in keeping the audience on the edge of their seats!  She has performed in Maryland, North Carolina, Washington D.C., Detroit, Michigan all around Richmond, Virginia. ', 3, 'Burly pics DC, Michigan Burlesque Festival, Purrlesque Follies', '', ''),
(53, 77, 'Whoaaa Nellie!', 'http://www.janellburgess.com/', 'Janell Burgess aka “Whoaaa Nellie!" has been performing burlesque and teaching sultry movement to all levels of movers for over a decade now….she has been featured in Vertical Art and Fitness Magazine,  performed in the legendary Dixie Evans Burlesque Hall of Fame, is former Las Vegas Showgirl,  and a frequent cast member of one of LA’s hottest reviews, “Girl Next Door”, Janell is a fun and inspirational performer not to be missed!  Currently Ms. Burgess resides in Los Angeles, CA and is a backup dancer for the legendary KC & The Sunshine Band!\r\n', 10, '', 'uploads/images/172195_1474123667695_1671802391_874384_5943556_o.jpg', ''),
(54, 80, 'Dot Mitzvah', 'http://www.dotmitzvahonline.com/', 'Born from a delirious one-night stand between a rabbi from Flatbush Avenue and a Lotte Lenya impersonator, Dot Mitzvah bravely carves a place in the burlesque world with a mix of comedy, music, and good ol'' fashioned cheesecake.\r\n\r\nAs a burlesque artist, Dot has has had the honor of performing with the New York School of Burlesque, Kitty Nights NYC, Bon Appetit Burlesque, Brick City Burlesque, and many other venues. She was the first winner of the  "Best Hybrid Performance" at 2012''s Great Burlesque Exposition, "Best Variety Act" at 2012''s Great Southern Exposure Pageant, and the "WTF Award" at the 2014 Alternatease Neo-Burlesque Festival in Cambridge, MA. She was also featured in the documentary "The Road Less Traveled".\r\n\r\nHer goal is to bring opera and burlesque to a more contemporary audience, so shake the dust off and check her out!', 5, 'Finalist, World Burlesque Games 2012\r\n"Best Hybrid", Great Burlesque Expo 2012\r\n"Best Variety", Great Southern Exposure 2012\r\n"WTF Award", Alternatease 2014', 'uploads/images/Dot_Mitzvah.jpg', ''),
(55, 29, 'Vivi Noir', '', '\r\nVivi Noir, a New Jersey native, began her career as a ballet and modern dancer. She later used her theatric and jazz background to start a jazz inspired cabaret troupe, Pride & Nvy Cabaret Co. Through her works with the cabaret she was introduced to the wonderful world of burlesque and side show.  Since then she has been seen at The Borgata''s ''The Burlesque Show'', The NY Burlesque Fest., Virginia Burlesque Fest., NJ Burlesque Showcase, and other numerous festivals. Vivi is a member of Smoke & Mirrors Peepshow, Ambience Artistry, and is connected with The Garden-state Beard and Mustache Society. Miss Noir has also been view in Weird NJ as well as the Katie Couric Show.  ', 1, '', 'uploads/images/image_2.jpg', ''),
(56, 82, 'Vince V. Vice', 'http://www.burlesquebitch.com/article.php?id=2905', 'BIO: Expose Yourself to.. Vince V. Vice! A producer and male burlesque performer\r\nHe has been performing for 4+ years, trained in various amounts of dance forms. Mr. Vice has performed all over the country from Colorado to Michigan, Wisconsin to Illinois, Washington State, Michigan, North Carolina, New York City and this upcoming Fall he makes his International Burlesque Debut in Europe at The Dublin Burlesque Festival & Amsterdam to compete for the Tittle of King at Amsterdam Burlesque Award (November 2014).\r\n\r\nFacebook ''Like'' Page: www.facebook.com/vanity.vicelord', 5, '', 'uploads/images/Vince_V._Vice_Strong.jpeg', ''),
(57, 86, 'Boobs Radley', 'http://www.facebook.com/bubes.radley', 'Boobs Radley’s mother claims that Boobs “was raised right”, all evidence to the contrary. As a small child she had a respectable life of plaid, mary janes and kickball as a Catholic school girl. But Mom didn’t count on two influences: the theater and an HBO special on striptease. A junior high school play introduced Boobs to the irresistible one-two punch of applause and false eyelashes and it was all downhill from there. An introduction to drag queens in college cemented her love of vodka and all things sparkly. Boobs is currently performing at various venues in the Chicago burlesque scene and pursuing her dream of becoming Norman Reedus’ personal sponge bather. ', 4, 'Best Singer, Burlypicks Illinois 2014', 'uploads/images/boob2014-3_face.jpg', ''),
(58, 88, 'Fancy Feast', 'http://www.fancyfeastburlesque.com/', 'Fancy Feast has been performing her unique brand of slightly surreal, genre-blending burlesque for three years now. She holds the current title of Miss Bushwick Burlesque 2014 as well as recently being named ''Judges'' Choice for Most Classic'' at the Alternatease festival in Boston. When she is not hosting or performing, she is also an administrator at the New York School of Burlesque.', 3, '2014: Miss Bushwick Burlesque\r\n2014: Judges'' Choice Award for Most Classic at Alternatease', 'uploads/images/Fancy_Feast.jpg', ''),
(59, 89, 'Cami Oh', 'https://www.facebook.com/camiohknox', 'New on the burlesque scene, Cami Oh was born and raised in Knoxville, TN. Cami currently trains in various types of dance including ballet, jazz, hip-hop, belly dance, cabaret, and burlesque. Cami also co-directs and stars as Dr. Frank N. Furter in the yearly production of the Rocky Horror Picture Show at the Historic Tennessee Theatre. Traveling is of great interest to her and early this year she performed at Heavy Rebel Weekender in Winston-Salem, NC. As a lady who knows what she wants (tacos and cats), her quick wit and contagious smile are sure to steal any heart but admirers be warned - she truly lives up to her moniker as the "Sassysquatch of the Southeast!"', 1, '', 'uploads/images/Cami_Oh.jpg', ''),
(60, 70, 'Penny Wren', 'http://www.pennywrenburlesque.com/', '\r\nBest known as the "Perverted Pixie of Burlesque," Penny Wren is a wide-eyed danger.  Her first burlesque stage performance took place in September of 2011, though she has been dazzling New York audiences since 2007 as a modern dancer and choreographer.  Ms. Wren is a scintillating whirlwind whose antics are rife with narrative.  She is altogether charming, kooky and seductive.', 3, '', 'uploads/images/Penny_Wren_0450_FINAL1.jpg', ''),
(61, 90, 'Guilted Lilly', '', 'Guilted Lilly began taking classes with the Rhode Island Burlesque Academy in the fall of 2011.  Coached by the lovely Lady Miss Iris and Bettysioux Tailor, she fell in love with the art of the tease.  This makes sense, of course, seeing as she has always enjoyed prancing about in skimpy outfits.  Though she still considers herself to be relatively new to the performance side of burlesque, Lilly captivates audiences with her beautiful singing voice and her love of physical comedy.  Not to mention her jaw-droppingly bodacious bod. ;)', 2, '', 'uploads/images/Screen_Shot_2014-10-21_at_1.24.50_PM.png', ''),
(62, 91, 'Tyranna Suarez', '', 'After incubating at the RI Burlesque Academy,Tyranna Suarez only recently hatched into the burlesque scene in an explosion of feathers, sequins, and amniotic fluid. Overcoming comically tiny arms to win Rogue Burlesque’s Lucky 13 competition, she was very excited to be able to perform in their Secret Show this spring. She''s thrilled to finally find a medium that perfectly blends her two favorite things: bad puns and boobs. Her spare time is spent dancing, forcing cuddles on unappreciative cats, and trying to attain her dream of becoming a Pokémon Master. ', 1, 'Winner Rogue Burlesque Lucky 13 competition September 2013', 'uploads/images/coconut.jpg', ''),
(63, 79, 'Poison Ivory', 'http://www.misspoisonivory.com/', 'Part goddess, part femme fatale, part hedonist, and newly crowned\r\nMiss Starlet Burlesque at the Hollywood Burlesque Festival…\r\nPoison Ivory is no longer up-and-coming, but is a Burlesque performer who has already begun to make her mark.\r\n\r\nWithin months of starting her journey, Poison was nominated for\r\nHottest Freshman at the 2012 New York Burlesque Festival. She recently took home the first place Crystal Corset Award at the 2014 Pennsylvania Burlesque Festival and was named Most Classic performer at the 2014 BurlyPicks Finals. Now, with multiple festivals, accolades, and a\r\ntitle under her garter, it is clear that Poison Ivory is a force to be\r\nseen.\r\n\r\nShe combines her exceptional musicality with sultry, and sensual\r\nmovements that always leave her audience wanting more. She is brown\r\nsugar and spice; she is a deadly device.\r\n', 3, '\r\nFirst Place Crystal Corset Award at the 2014 Pennsylvania Burlesque Festival\r\n\r\n\r\nBurlyPicks Finals (Hollywood)\r\nMost Classic Performer 2014\r\n\r\nBurly Picks Rigional (NYC)\r\nFirst Place Solo act.\r\n\r\n\r\nCrowned Miss Starlet Burlesque at the 2013 Hollywood Burlesque Festival \r\n\r\nNominated Hottest Freshman at the 2012 New York Burlesque Festival \r\n\r\n\r\n\r\n', 'uploads/images/Ivory_KB_ES2.JPG', '');
INSERT INTO `gbe_performer` (`id`, `contact_id`, `name`, `homepage`, `bio`, `experience`, `awards`, `promo_image`, `festivals`) VALUES
(64, 93, 'Vonka Romanov', 'https://www.facebook.com/Romanov.Vonka', 'Vonka is a living fetish and a natural bluenette. This dirty jersey girl has been doing burlesque for 2 years. She is a cosplayer and Nerdlesque performer with Ink & Paint Club Burlesque and D20 Burlesque. Vonka is known as The Goddess of Tits and Wine and plans to one day rule the Earth', 2, '', 'uploads/images/Vonka_Romanov.JPG', ''),
(65, 76, 'Carmen del Fuego', '', 'After becoming suddenly unemployed in February of 2014, Carmen had nothing but time to use a Groupon for Intro to Burlesque classes at the Boston Academy of Burlesque Education. After her first class out of four she marched up to her instructor and said, "I want to do this, like, all the time!" She later saw a Burlesque Your Way class that helped her to craft a solo performance that she debuted in September.\r\n\r\nCarmen has almost no dance background, though you will see her hips remember a semester of bellydance taken in college! Mostly she brings to the stage enthusiasm, joy, and lots of love for her body, plus some mystifying hip articulation!', 1, '', '', ''),
(66, 94, 'Delilah Spring', 'https://www.facebook.com/delilah.spring.5', 'The glittering love child of Daisy Buchanan and Jay Gatsby, Delilah Spring is a dichotomy of innocence and evil. Raised in a world of sequins, jazz and champagne, Delilah’s got a taste for the good life and a penchant for mischief. Delilah will tickle you pink with her feathers and tantalize you with her playful brand of sexy.\r\n', 3, '', 'uploads/images/Delilah_Spring3.jpg', ''),
(67, 95, 'Phaedra Black', 'http://www.phaedrablack.com/', 'Phaedra Black is a villainous seductress best known for her perilous contour hailing from Chicago. She formerly appeared on the Gorilla Tango Burlesque, and can regularly be seen performing at Ties ''n Tassels and Festival of Flesh. She is also a founding member and producer for Chicago''s newest burlesque troupe The Better Boobie Bureau.', 3, '', 'uploads/images/Phaedra.Black_by_El_Dawn.jpg', ''),
(68, 95, 'Better Boobie Bureau', 'https://www.facebook.com/BetterBoobieBureau', 'The troupe that is in the business of boobies and booties, bringing diversified burlesque and variety entertainment to Chicago since 2014.', 1, '', '', ''),
(69, 97, 'Lucy Buttons', 'http://lucybuttons.com/', 'Lucy Buttons, "The Queen of Rock and Roll Burlesque," exploded onto the scene instantly becoming a headliner and force to be reckoned with.  Her award-winning signature style has been featured in television, magazines, and film and made her a New York City Club Legend!  Also an accomplished ballroom dancer, this professional temptress produces sell-out shows and performs across the county from the Great Boston Burlesque Exposition, to the Windy City Burlesque Festival, and up to Montreal.  ', 8, 'Most Classic 2009\r\nDusty Summers Legend''s Choice 2009', 'uploads/images/Lucy_Buttons.jpg', ''),
(70, 98, 'CoCo LeBod', 'http://www.cabarretfit.com/divas-and-dolls-burlesque', 'CoCo was drawn to burlesque because of the community''s appreciation of the female body- all shapes, sizes, colors, etc. No matter who you are, you are sexy with burlesque! CoCo is a member of the South Florida burlesque troup, Divas and Dolls. \r\n\r\nWhen not performing, you can find CoCo studying her first loves- ballet, modern and musical theatre, as well as Pilates\r\n', 1, '', 'uploads/images/10363810_10154148981995371_211832580788734784_n.jpg', ''),
(71, 104, 'Mistress Leona Star', 'http://facebook.com/mistressleonastar', 'Mistress Leona Star began a career as a model and an actress and decided that burlesque had to be added to her list of conquests. Leona helped start Madame Morte and the Hard Candies a troupe based out of Northampton, MA. They went on to win second place at Valley FEAST a month after their debut show. Mistress Leona Star has performed with Bon Appetit Burlesque, Beat City Beauties, New Haven Burlesque, SWAN day CT and many other shows.  Mistress Leona Star gives her audience a wonderful mix of old glamour to down and dirty rock n roll routines. ', 3, 'Second Place at Valley FEAST', 'uploads/images/1093823_10201222327416106_522355076_o.jpg', ''),
(72, 101, 'Heather Whatever', 'https://www.facebook.com/heatherwhatevernyc', 'Heather Whatever was "discovered" dancing on a float at Coney Island''s legendary Mermaid Parade in Brooklyn, and became a burlesque performer under the tuteledge of Jo "Boobs" Weldon at the New York School of Burlesque. Since her debut, Heather has been making art all over the East Coast, and is proud to now be a part of the Capital Region''s emerging burlesque scene. \r\n\r\nSome of Heather''s career highlights include performing at NYC''s Slipper Room, Webster Hall, Stonewall Inn, and at Coney Island''s Burlesque at the Beach. Heather was also a featured performer this summer at Longhouse Reserve''s White, Hot + Blue benefit show in East Hampton, NY, and was chosen to compete among a selected group of professional burlesque performers at the first annual "Pastie Punch-Out" in Northampton, MA. A real life mermaid, Heather has also performed with the Brooklyn Peaches synchronized swimming troupe. \r\n\r\nHeather has also contributed her writing and performing talent to Pink Light Burlesque, a free burlesque educational program for survivors of breast cancer, and is honored to have been chosen to be on the faculty this year at BurlyCon, the premier burlesque educational convention in Seattle, WA.', 3, 'In 2014, I was selected to compete in the very first "Pastie-Punch Out", a competition of professional neo-burlesque performers sponsored by Bon Apetit burlesque in Northampton, MA. I was also honored to be named to the faculty of BurlyCon 7 in Seattle, where I taught my synchronized swimming class for the first time to burlesque performers!  ', 'uploads/images/Heather_Whatever2015.jpg', ''),
(73, 99, 'Prima Vera', 'https://www.facebook.com/primaverachibq', 'Once a ballerina whose career was tragically cut short by her love of carbs and red wine, Prima Vera is taking the Chicago burlesque scene by storm as a song singer, choreographer and taker offer of the clothings.\r\n\r\nShe''s been seen at the Vermont Burlesque Festival, Diversi-Tease in Minneapolis, Show Me Burlesque in St. Louis as well as all over Chicago.\r\n\r\nShe is the Artistic Director of Phoenix Rising Chicago/Dirty Bird Burlesque and also a member of the Better Boobie Bureau. ', 3, 'Winner of 2011 Chicago Raw Artists Performing Arts division. \r\nIowas Burlesque Festival', 'uploads/images/10398032_1438309853090385_4252038625219838141_n.jpg', ''),
(74, 106, 'BLONDY VIOLET', 'https://www.facebook.com/BlondyViolet', 'I started as a contemporary dancer when I was 7 years old until 21st years old. I’ve been attending  Silk Ribbon Sisters academy in Reggio Emilia (Italy) for 3 years (teacher: Nuit Blanche) including some workshops with international performers (MITZI VON WOLFGANG, CLEO VIPER, MILENA BISACCO, ANGIE PONTANI, NATSUMI SCARLET, JO WELDON, GRACE HALL, DIXIE RAMONE, DIRTY MARTINI, KOKO LA DOUCE).\r\nI’ve been on stage for almost 3 years as a Burlesque performer with some group/solo performances. \r\n\r\nBURLESQUE EXPERIENCE: \r\na)	Partecipant at 2nd LINDAU BURLESQUE AWARD 20th October 2012 \r\nb)	American’s Fun in Reggio Emilia (FAIR DEDICATED TO AMERICAN CULTURE)  - MAY 2012\r\nc)	“REPLAY“ in Reggio emilia, an event dedicated to 50s rock’n’roll – 29TH SEPTEMBER 2012\r\nd)	3 days TOUR in Germany on April 2013\r\ne)	American’s Fun in Reggio Emilia (FAIR DEDICATED TO AMERICAN CULTURE)  - MAY 2013\r\nf)	10th ROCKABILLY BOMBARDEMENT – AUSTRIA – 20th/21st Sept 2013\r\ng)	BENEFIT SHOW FOR CAT HOSPITAL “MIAO BENEFIT” In Bologna (29th March 2014)\r\nh)	BURLESQUE IDOL – 5heat – Madame Jojo’s Theatre – LONDON - 30th May 2014\r\ni)	DUBLIN BURLESQUE FESTIVAL – Newcomer category (6-9/11/2014)\r\na)	Some solo/group performances in different venues/benefit event near my town: PERNILLA (Modena), Caffè Concerto (Modena); Spazio Reno Theater (Calderara di Reno – BOLOGNA) …and some others in Reggio Emilia\r\n\r\nBlondy Violet ‘cuz I want to deny the common idea that blondes are silly: I love mixing some dance background with the self-irony, hilarity and INTELLIGENT satire even if I’m "Blondy". Than I wants to deny the italian show-business superstition that Violet brings bad-luck on stage, I want my preferred colour always with me, my identity card. Superstition doesn’t belong to me! Let you attract to my own world which goes against the grain!  \r\n\r\nI love being on stage performing burlesque and it''s one of the most exciting situation, I feel really good seducing, involving and making the audience smile.', 2, 'FESTIVAL and CONTEST I appeared in are listed in the BIO', 'uploads/images/BLONDY_VIOLET_1.jpg', ''),
(76, 110, 'Mika Romantic', 'http://www.mikaromanticofficial.com/', 'I''m a burlesque performer and model based in eastern Pennsylvania. I studied at the New York School of Burlesque in Spring 2012, since my debut I''ve been a traveling performer being welcomed to a variety of shows and venues along the East Coast. I co-produces the burlesque troupe, "The Looking Glass Revue". A classic vaudeville styled group who have entertained at venues such as: Hark Rock Cafe and The Social Film Loft at Sundance Film Festival. Along with the troupe, I''ve produced private events in the local area and taught burlesque workshops that focus on women''s confidence.', 3, 'Queen Of The Bowery Burlesque Pageant 2012', '', ''),
(77, 112, 'May Hemmer', 'http://www.mayhemmer.com/', 'Known as "The Sassiest Thing in New Orleans", May Hemmer has been burning up every stage that she touches.\r\n\r\nMay began her burlesque career in August of 2011 at Bella Blue''s New Orleans School of Burlesuqe before performing in her first showcase that following October.  That was just the start as she fell even more in love with the art of the striptease and began to immerse in the burlesque community around the city.\r\n\r\nIn January of 2012, she joined the very successful and longest running burleseque troupe: The Storyville Starlettes, who gave her the shot she wanted.  This was the pivotal point where she decided this was her passion, and it''s only been up from there!!!', 3, '-Phoenix Comic Con 2013: Talk Nerdy to Me Burlesque Showcase\r\n-Burlescapades'' Cinelesque 2013\r\n-Southern Fried Burlesque Festival 2014:  Just Hatched Showcase', 'uploads/images/285750_343097532467129_2113717734_n1.jpg', ''),
(78, 113, 'Lushes LaMoan', 'http://www.facebook.com/lusheslamoanburlesque', 'Stage bio: \r\nLushes LaMoan is Detroit hardest working showgirl. with her classic curves and comedic cures, she''s sure to make your empty glass full. Raise your drinks and toast to the intoxicating lady of lust, Lushes LaMoan.', 7, 'Burly picks regional winner, master of assets and tassels, and improv', '', ''),
(79, 114, 'Vera Wylde', 'https://www.youtube.com/user/VeraWylde', 'Vera Wylde began performing something closer to traditional drag in Boston before moving to NYC and discovering burlesque. She hasn''t looked back since. She was part of the Brooklyn troupe Switch ''N Play before returning to Vermont, where she grew up. She never misses a chance to perform her unique brand of gender bending burlesque.', 10, '', 'uploads/images/10527879_10203598224110600_6994875649320373651_n.jpg', ''),
(80, 116, 'Rasa Vitalia', 'http://www.RasaVitalia.com/', 'Rasa Vitalia: Hot Dance, Music, and Vocal Artist & Entertainer\r\n\r\nRasa Vitalia is an award-winning dance performer, vocalist, and songwriter, and one of America''s most highly regarded popular solo entertainers.  She tours as a professional solo dance performer and  MC vocal artist, performing to her own songs in live music venues, concerts, clubs, discos, performance art, variety, circus, burlesque shows,  cabarets, & much more. Her influences include music and dance from around the world, as well as EDM, PLUR, disco, club, pop, funk, hip hop, and electronic dance music. Her influences include music and dance from around the world, as well as disco, club, pop, funk, hip hop, and electronic dance music.  Due to her notoriety and show-womanship, Rasa Vitalia is frequently invited to be a featured artist in professional live music and variety show productions around the world with a wide variety of talented entertainers including popular platinum record grammy winning live music artists. She has won numerous awards including San Francisco''s RAW Performing Artist of the Year 2011-2012, Supperclub San Francisco Artist in Residence 2012-2013, Winner of KOFYTV Dance Party Queen 2014,Winner of Burlesque Idol at the Triad Theater, New York City in July 2014, Winner of the Filthy Gorgeous Talent Show New York City 2014, as well as headlining the New York City Burlesque Festival 2014.  In her performances, Rasa presents a multitude of dance talents in a variety of music genres and cultures.  Rasa performs at numerous corporate, private, and public events, festivals, parties, shows, universities, radio stations, and major venues all over the US.  Rasa Vitalia''s unique presentation of diversity, her fantastic flexibility and level of talent, and her strong diverse cultural knowledge in music and dances around the world, makes her an asset at all for those who seek specific music or cultural styles, as well as for others who enjoy Rasa''s unique style of the hot and beautiful - charged with beauty, enthusiasm and energy like no other! No matter your cultural background or unique way of being, she unites all to celebrate diversity and peace though dance and music. Wow! Magnetic! Rasa Vitalia puts on a high-energy interactive multi-media dance party that will get anyone to move to the groove and lose themselves in moments of greatness. Her large, loyal, and diverse following can''t get enough booty shakin'' fun!  \r\n', 16, '. She has won numerous awards including San Francisco''s RAW Performing Artist of the Year 2011-2012, Supperclub San Francisco Artist in Residence 2012-2013, Winner of KOFYTV Dance Party Queen 2014,Winner of Burlesque Idol at the Triad Theater, New York City in July 2014, Winner of the Filthy Gorgeous Talent Show New York City 2014, as well as headlining the New York City Burlesque Festival 2014. ', 'uploads/images/Photolena_RasaVitalia_hires.jpg', ''),
(81, 117, 'Attica Wilde', 'https://www.facebook.com/theatticawilde', 'Being born in the deepest, darkest regions of the great New Jersey, Attica Wilde led a rather unexciting existence for the greater part of her life. Knowing there was more to be had in this expansive world, Miss Wilde was constantly reaching for the stars. Like the mythical Phoenix, Attica was to be reborn in a firestorm of glitter and rhinestones through the art of Burlesque dancing.\r\nAttica is completely self taught; learning the art through the rigorous studies of greats such as Dita Von Teese, Michelle L''amour, Angie Pontani, and of course Veronica Varlow, some trial and error, and hours of practice behind closed doors. Not content with simply imitating others, as “Imitation is suicide,” Miss Wilde could not help but to add her own charming personality to all of her performances. Attica has now come into her own as a confident entertainer, despite her small start. She has performed all over New Jersey, New York, and occasionally ventures as far as Baltimore. Even though she came so far in so little time, Attica can still remember the encouraging words Veronica Varlow spoke to her on a wintery night in New Jersey and, is eternally grateful for them.\r\nAttica finds herself more at home between the pages of the F. Scott Fitzgerald Classic, The Great Gatsby, than the in humdrum of modern day and, as a result, draws her aesthetics from the glamor of the 1920s. However, she is not a girl afraid to get her hands, hair, dress, or shoes dirty, and often draws influence for her acts from the classic horror movies which she adores. Do not fret, Attica is a woman who prides herself on her boundless class and style and, would only use gallons of glitter blood if she felt the act was tasteful.\r\nAttica is currently a member of Brunswick Basement Burlesque,  Ambience Artistry, and has been the guest of many others. Attica leads Smoke & Mirrors Peepshow, her own burlesque troupe in which she wears many hats from dancer to producer to stage manager, she is affectionately called "The Madame."  Miss Wilde is ready to take the world by storm with the help of a few beautifully talented and glittery friends.  ', 4, '', 'uploads/images/glove.jpg', ''),
(82, 117, 'Smoke & Mirrors Peepshow', 'https://www.facebook.com/smokeandmirrorspeepshow', 'Smoke & Mirrors Peepshow is an up and coming New Jersey based classically inspired  burlesque troupe that harkens back to the decadent hey day of vintage burlesque, led by Attica Wilde featuring Vivi Noir and Ivory Askew. They are supported by a bevy of lovely ladies. ', 1, '', 'uploads/images/SMOKEMIRRORS_FINAL.jpg', ''),
(83, 121, 'Roxy Stardust', 'https://www.roxystardust.co.uk/', 'With many years experience on the stage, Roxy Stardust combines her knowledge of acting, singing, and dance to create unique, fun and quirky routines that light up even the darkest rain cloud! \r\n\r\n\r\nSpecializing in Singing and Comedic routines, Roxy is the mastermind behind  Monster-A-GoGo, Roxy''s Round-Up and various other shows the UK. Roxy is the founder and co-host of "The Lonely Hearts Club" which she coordinates with Drag Queen Miss Lily Minogue. In 2013 Roxy also produced her first show at The Edinburgh Fringe and in May on 2013 she will have two shows at Glasgow''s own Southside Fringe.\r\n\r\n\r\nShe''s a professional events organizer, a cabaret artiste and she''s not too bad dealing with hecklers either! No audience is too big of small, Roxy will always give it her all!\r\n\r\n\r\nSo if its fun, frolics, and a cheeky wee wink yee seek then add a little sprinkle of Stardust to get the ball rolling', 6, 'Winner of the Tea Time Tassel Off 2013 Funniest Flinger Award\r\nWinner of 1st Place in the 1st Tiny Tea Time Tassel Off at The Edinburgh Fringe 2013', 'uploads/images/tumblr_n144hnxg3o1qlwxtxo1_500.jpg', ''),
(84, 2, 'Mr. Scratch', 'http://www.BostonBabydolls.com/', 'Scratch is the founding chair of The Great Burlesque Exposition and the director and producer of The Boston Babydolls.', 10, '', 'uploads/images/Scratch_horns3.jpg', ''),
(85, 2, 'The Boston Babydolls', 'http://www.BostonBabydolls.com/', 'The Boston Babydolls are New England''s premiere burlesque troupe.  They have won awards from all of the major local newspapers and have twice been named to the top 5 theater troupes in Boston by WGBH''s "The A-List".', 9, '', 'uploads/images/group-shot.jpg', ''),
(86, 122, 'Jolie Stripes', 'http://www.joliestripes.com/', 'Born and raised in the province of Québec, Jolie Stripes imposes herself as one of the figureheads of French Canadian burlesque on the North-American scene. Distinguishing herself with her unique "High Gothic" aestheticism  et and sensual dance style, she is one of the few performers to be officially endorsed by burlesque legend Tempest Storm. Jolie Stripes is a board member for the Ottawa Burlesque Festival, the producer of the critically-acclaimed Cabaret Clandestin, the only francophone burlesque show in the Ottawa valley, and the co-founder of the Appeelers, the first mixed-gender vaudeville troupe in Ottawa.', 3, 'Vermont Burlesque Festival\r\n', 'uploads/images/Jolie_Stripes_1.jpg', ''),
(87, 120, 'Luella Lynne', 'http://luellalynnenyc.wix.com/luellalynne', 'The Double D Agent of burlesque, Luella Lynne began her performing career in 2014 with performances at the NY School of Burlesque Student Showcase at The Slipper Room in NYC.  She is currently developing more acts with a focus on seduction through the lens of espionage as an agent provocateur.', 0, 'N/A', 'uploads/images/HR_DSC_0750.jpg', ''),
(88, 99, 'Dirty Bird Burlesque', 'http://www.phoenixrisingchicago.com/', 'Phoenix Rising Chicago gathered together in the Fall of 2011 over an undisclosed amount of tequila. They realized they didn''t want to be bound by industry expectations of what a small, local performing company should be and what their limitations are. Small performing companies CAN be influential to the industry, especially in a place like Chicago. They can push the limits of conventionality when it comes to choreography, costume, aesthetic. Dirty Bird Burlesque is Phoenix’s newest venture since there shouldn''t BE limits, that''s why we''re artists!', 4, '2011 Chicago Raw Artists Performing Artist of the Year\r\nVermont Burlesque Festival\r\nDiversi-Tease\r\nShow Me Burlesque\r\nIowa Burlesque Festival', '', '');
