ntic and racy! Plus you''ll be able to buy many of the fashions from the vendors!</LI><BR><li> <b>The Art Show</B> <i>Saturday & Sunday, noon to 8:00 p.m.</I>: Every year we present a creative collection of artwork inspired by the burlesque world, from drawings to photographs, to sculpture.</LI></UL>\n</ul>\n<I>Plus...</I> As we did last year, we are reserving the first four rows at <I>The Rhinestone Revue, The Main Event,</I> and <I>The Sunday Showcase</I> for our "Socialite" and "Whole Shebang" attendees!\n\n\nPurchased separately, these tickets would cost you over $200 -- and some of them can''t be bought at any price! But a <I>Socialite Passport</I> can cost you as little as $125.00!', 0, '150.00', '2014-08-23 18:53:49', 'BPT Auto Import'),
