(12, '799475-3255898', 'The Scholar', 'The reason you come to <I>The Great Burlesque Exposition</I> is the classe, plain and simple. <I>The Scholar''s Pass</I> was designed just for you, and includes:\n<UL>\n<LI> One admission to <B>The Conference</b> on Friday, Feb. 20\n<LI> One admission to <B>The Conference</b> on Saturday, Feb. 21\n<LI> One admission to <B>The Conference</b> on Sunday, Feb. 22\n<LI>Plus everything in the <B>Fan Admission</B> and breakfast on Saturday and Sunday\n<uL><BR><li><b>The Drop-In Classes:</B> Taught by instructors from <a href=http://www.StudyBurlesque.com>The Boston Academy of Burlesque Education</a>, drop-in classes teach all the burlesque basics. Each of the three 30-minute classes covers different subject matter: <i>Burlesque Bumps ''n'' Grinds</I>; <i>Keeping the Tease in Striptease</I>; and <i>Beautiful Boas</I> plus there''s a special sampler class at 7:00 p.m. for your pre-show entertainment! Classes are taught every hour on the hour from 1:00 p.m. to 7:00 p.m. on both Saturday, February 21 and Sunday, February 22. <i>Please note that The Drop-in Classes are <u>not</u> the same thing as The Conference or The Master Classes, both which require a separate registration fee.</i></li><BR><li> <b>Meet The Legends</B> <i>Saturday, noon to 1:00 p.m.</I>: Our special guest stars share the secrets of burlesque, both "back in the day" and what it''s like today!</LI><BR><li> <b>The Costume Exhibit</B> <i>Saturday & Sunday, noon to 8:00 p.m.</I>: You can''t take it off until you put it on! Feast your eyes on the most gorgeous creations from around the world! Curated by Rhode Island''s own BettySioux Tailor, The Costume Exhibit features a mix of new and historic costumes.</LI><BR><li> <b>The Fashion Show</B> <i> Sunday, noon</I>: A perfect post-Valentine mix of romantic and racy! Plus you''ll be able to buy many of the fashions from the vendors!</LI><BR><li> <b>The Art Show</B> <i>Saturday & Sunday, noon to 8:00 p.m.</I>: Every year we present a creative collection of artwork inspired by the burlesque world, from drawings to photographs, to sculpture.</LI></UL>\n</ul>\n\nSince we know Scholar''s are both thrifty and wise, we''re offering a test to see how smart you are: register for your <I>Scholar''s Pass</I> sooner and save money, or wait to register until the last minute and pay a higher fee? Which is the smarter answer?', 0, '150.00', '2014-08-23 18:53:49', 'BPT Auto Import'),
