ar we present a creative collection of artwork inspired by the burlesque world, from drawings to photographs, to sculpture.</LI></UL>\r\n</ul>\r\n\r\nSince we know Scholar''s are both thrifty and wise, we''re offering a test to see how smart you are: register for your <I>Scholar''s Pass</I> sooner and save money, or wait to register until the last minute and pay a higher fee? Which is the smarter answer?', 1, '100.00', '2014-08-23 19:00:16', 'scratch'),
(15, '799491-3255987', 'Application Fees', 'The application period for The Great Burlesque Exposition is open from August 22, 2014 through October 22, 2014.  Notifications to performers will go out on or about December 1, 2014.\n\n<B>Applications between August 22 and September 22 are $15 and we pay the ticketing fees; after September 22, they are $20 <I>plus</i> the ticketing fees!</B>\n\nThe Great Exposition will be held February 20-22, 2015 at The Hyatt Regency Hotel in Cambridge, MA.  Special guests include: Angie Pontani, Miss Exotic World 2008; eye-popping pop icon, Kitten Natividad; the out-of-this-world Ray Gunn; Nina La Voix; Whisper de Corvo; Red Velvet; Scarlet Starlet; Blaze, the Red Rose of Texas; Scandal from Bohemia; The Boston Babydolls; and more.', 0, '20.00', '2014-08-23 18:53:49', 'BPT Auto Import'),
(16, '799491-3255986', 'Application fees', 'The application period for The Great Burlesque Exposition is open from August 22, 2014 through October 22, 2014.  Notifications to performers will go out on or about December 1, 2014.\n\n<B>Applications between August 22 and September 22 are $15 and we pay the ticketing fees; after September 22, they are $20 <I>plus</i> the ticketing fees!</B>\n\nThe Great Exposition will be held February 20-22, 2015 at The Hyatt Regency Hotel in Cambridge, MA.  Special guests include: Angie Pontani, Miss Exotic World 2008; eye-popping pop icon, Kitten Natividad; the out-of-this-world Ray Gunn; Nina La Voix; Whisper de Corvo; Red Velvet; Scarlet Starlet; Blaze, the Red Rose of Texas; Scandal from Bohemia; The Boston Babydolls; and more.', 0, '13.54', '2014-08-23 18:53:49', 'BPT Auto Import'),
(17, '799491-3255985', 'VIP - Comp', 'The application period for The Great Burlesque Exposition is open from August 22, 2014 through October 22, 2014.  Notifications to performers will go out on or about December 1, 2014.\n\n<B>Applications between August 22 and September 22 are $15 and we pay the ticketing fees; after September 22, they are $20 <I>plus</i> the ticketing fees!</B>\n\nThe Great Exposition will be held February 20-22, 2015 at The Hyatt Regency Hotel in Cambridge, MA.  Special guests include: Angie Pontani, Miss Exotic World 2008; eye-popping pop icon, Kitten Natividad; the out-of-this-world Ray Gunn; Nina La Voix; Whisper de Corvo; Red Velvet; Scarlet Starlet; Blaze, the Red Rose of Texas; Scandal from Bohemia; The Boston Babydolls; and more.', 0, '0.00', '2014-08-23 18:53:49', 'BPT Auto Import'),
(18, '825409-3285454', 'Salon Vendor', 'As a vendor at <I>The Great Burlesque Exposition</I> you get an 8''x8'' booth area, a <I>free</i> 6'' table (if you request it), two chairs, and 16 hours of sales the week after Valentine''s Day!\n\nPlease see the Vendor Page on <a href=http://www.Burlesque-Expo.com>our website</a> for more information!\n\n<h2>TWO WAYS TO SELL</h2>\n<h3>The Vendors'' Hall: </h3>\n<i>Please Note: There are only 30 vendor booths available in The Vendor''s Hall</i><BR>\nFrom Saturday, February 21 at noon until Sunday, February 22 at 8:00 p.m., The Presidential Ballroom of The Hyatt Regency Hotel is filled with everything a burlesque performer or fan of burlesque could want.  From cosmetics to fashion accessories to memorabilia, our vendors sell it all, from family-friendly to risqué.  The Vendors'' Hall is ideal for merchants who sell smaller items or whose customers do not need to try on clothing.\nAll booth spaces are 8''x8'', about half are against a wall.  Each booth space comes with two chairs and four vendor badges.  Additional badges are available upon request.  As many of our vendors prefer to bring their own racks or displays, we do not automatically include tables with the rental of a vendor space.  Tables (3''x6'') with tablecloths are available in advance when you book your booth.\n\n<H3>Salon Vendors: </h3>\n<i>Please Note: You Must Rent A Hotel Room to Be A Salon Vendor</i>\nFor those vendors who wish a larger set-up, to set their own hours, or who have higher end or more custom products, we offer ''Salons'', the opportunity to vend your wares out of a hotel room.  All Salon vendors will be grouped together on the second floor, directly above the rooms used for the conference and adjacent to the hotel restaurant.  Signage throughout the event space directs attendees and hotel guests to the Salon Vendors.\nTo be a salon vendor you must both complete a vendor application with application fee and reserve a hotel room.  Salon Vendors are welcome to stay in their "stores" or may rent a second room for sleeping.', 0, '50.00', '2014-08-23 19:03:55', 'BPT Auto Import'),
(19, '825409-3284925', 'Vendor Space (Double Booth)', 'As a vendor at <I>The Great Burlesque Exposition</I> you get an 8''x8'' booth area, a <I>free</i> 6'' table (if you request it), two chairs, and 16 hours of sales the week after Valentine''s Day!\n\nPlease see the Vendor Page on <a href=http://www.Burlesque-Expo.com>our website</a> for more information!\n\n<h2>TWO WAYS TO SELL</h2>\n<h3>The Vendors'' Hall: </h3>\n<i>Please Note: There are only 30 vendor booths available in The Vendor''s Hall</i><BR>\nFrom Saturday, February 21 at noon until Sunday, February 22 at 8:00 p.m., The Presidential Ballroom of The Hyatt Regency Hotel is filled with everything a burlesque performer or fan of burlesque could want.  From cosmetics to fashion accessories to memorabilia, our vendors sell it all, from family-friendly to risqué.  The Vendors'' Hall is ideal for merchants who sell smaller items or whose customers do not need to try on clothing.\nAll booth spaces are 8''x8'', about half are against a wall.  Each booth space comes with two chairs and four vendor badges.  Additional badges are available upon request.  As many of our vendors prefer to bring their own racks or displays, we do not automatically include tables with the rental of a vendor space.  Tables (3''x6'') with tablecloths are available in advance when you book your booth.\n\n<H3>Salon Vendors: </h3>\n<i>Please Note: You Must Rent A Hotel Room to Be A Salon Vendor</i>\nFor those vendors who wish a larger set-up, to set their own hours, or who have higher end or more custom products, we offer ''Salons'', the opportunity to vend your wares out of a hotel room.  All Salon vendors will be grouped together on the second floor, directly above the rooms used for the conference and adjacent to the hotel restaurant.  Signage throughout the event space directs attendees and hotel guests to the Salon Vendors.\nTo be a salon vendor you must both complete a vendor application with application fee and reserve a hotel room.  Salon Vendors are welcome to stay in their "stores" or may rent a second room for sleeping.', 0, '325.00', '2014-08-23 19:03:55', 'BPT Auto Import'),
(20, '825409-3284927', 'Vendor Space (Double Booth)', 'As a vendor at <I>The Great Burlesque Exposition</I> you get an 8''x8'' booth area, a <I>free</i> 6'' table (if you request it), two chairs, and 16 hours of sales the week after Valentine''s Day!\n\nPlease see the Vendor Page on <a href=http://www.Burlesque-Expo.com>our website</a> for more information!\n\n<h2>TWO WAYS TO SELL</h2>\n<h3>The Vendors'' Hall: </h3>\n<i>Please Note: There are only 30 vendor booths available in The Vendor''s Hall</i><BR>\nFrom Saturday, February 21 at noon until Sunday, February 22 at 8:00 p.m., The Presidential Ballroom of The Hyatt Regency Hotel is filled with everything a burlesque performer or fan of burlesque could want.  From cosmetics to fashion accessories to memorabilia, our vendors sell it all, from family-friendly to risqué.  The Vendors'' Hall is ideal for merchants who sell smaller items or whose customers do not need to try on clothing.\nAll booth spaces are 8''x8'', about half are against a wall.  Each booth space comes with two chairs and four vendor badges.  Additional badges are available upon request.  As many of our vendors prefer to bring their own racks or displays, we do not automatically include tables with the rental of a vendor space.  Tables (3''x6'') with tablecloths are available in advance when you book your booth.\n\n<H3>Salon Vendors: </h3>\n<i>Please Note: You Must Rent A Hotel Room to Be A Salon Vendor</i>\nFor those vendors who wish a larger set-up, to set their own hours, or who have higher end or more custom products, we offer ''Salons'', the opportunity to vend your wares out of a hotel room.  All Salon vendors will be grouped together on the second floor, directly above the rooms used for the conference and adjacent to the hotel restaurant.  Signage throughout the event space directs attendees and hotel guests to the Salon Vendors.\nTo be a salon vendor you must both complete a vendor application with application fee and reserve a hotel room.  Salon Vendors are welcome to stay in their "stores" or may rent a second room for sleeping.', 0, '450.00', '2014-08-23 19:03:55', 'BPT Auto Import'),
